    [],nt"revision_timestamp": "2015-05-06T22:31:05.749898",nt"name": "teams-model-for-the-hpgf-ln2-pump-system-diagnostic-utility-project",nt"isopen":
    true,nt"url": null,nt"notes": "&lt;p&gt;The engineering design group upgraded
    the liquid nitrogen pump system at the HPGF. The pump system supports the site-wide
    liquid nitrogen supply and its operation is critical for supporting test activities.
    The new pumping facility was designed with the capability for adding diagnostic
    utilities to promote health management of the new cryogenic pump skids. This project
    provides the health management capability by embedding the AAMU into the system
    providing real-time diagnostic feedback to operators and scheduling preventive maintenance.&amp;nbsp;
    To accomplish this, LabView&amp;reg; software interface communicates between the
    TEAMS Product Suite&amp;rsquo;s remote diagnostic server and the pumping control
    system to display operational health events and suggested maintenance to the user.&amp;nbsp;&amp;nbsp;&lt;/p&gt;",nt"license_title":
